    false,nt"url": null,nt"notes": "This file contains a feature class depicting
    National Forest System land parcels that have an                Congressionally
    designated boundary. Examples include National Wilderness Area,n                Primitive
    Area, or Wilderness Study Area. This dataset is derived from the USFSn                Southwestern
    Region ALP (Automated Lands Program) data Project. This is one of sixn                layers
    derived from ALP for the purpose of supplying data layers for recourse GISn                analysis
    and data needs within the Forest Service. The six layers are Surfacen                Ownership,
    Administrative Forest Boundary, District Boundary, Townships, Sections,n                and
    Wilderness. There were some gaps in the ALP data so a small portion of thisn                dataset
    comes from CCF (Cartographic Feature Files) datasets and the USFSn                Southwestern
    Region Core Data Project. ALP data are developed from data sources ofn                differing
    accuracy, scales, and reliability. Where available they are developed fromn                GCDB
    (Geographic Coordinate Data Base) data. GCDB data are maintained by the Bureaun
                   of Land Management in their State Offices. GCDB data are mostly
    corner data. Not alln                corners and not all boundaries are available
    in GCDB so ALP also utilizes many othern                data sources like CFF data
    to derive its boundaries. GCDB data are in a constantn                state of change
    because land corners are always being resurveyed. The GCDB datan                used
    in this dataset represents a snapshot in time when the GCDB dataset wasn                published
    by the BLM and may not reflect the most current GCDB dataset available.n                The
    Forest Service makes no expressed or implied warranty with respect to then                character,
    function, or capabilities of these data. These data are intended to ben                used
    for planning and analyses purposes only and are not legally binding withn                regard
    to title or location of National Forest System lands.",nt"license_title": null,nt"extras":
